import React from "react";
import { Search } from "antd";
function Filter(title, rate) {
  const onSearch = (value) => console.log(value);
  return (
    <div>
      <Search
        placeholder="input search text"
        allowClear
        enterButton="Search"
        size="large"
        onSearch={onSearch}
      />
      >
    </div>
  );
}

export default Filter;
